class AppDefines {

    static text = {
        titleHomeScreen: "Alarm",
        titleCreateionScreen: "Create alarm",
        titleRadioChoose: "Choose a radio:",
        titleNotification: "Alarm notification!",

        labelPlayingRadio: "Playing radio:",
        labelDisableAlarm: "Dismiss",
    };

}

export default AppDefines;
